import React from 'react';

function Footer(){
    return(
        <div style={{
            backgroundColor: 'ocean',
            margin: '50px',
            fontSize: 35,
            paddingLeft: '500px'
        }}>
            Selamat Datang di Sanbercode Todo
        </div>
    );
}

export default Footer;
